startMain();function startMain(){let jsRequiredDivName=`js-disabled`;let images=document.getElementsByTagName(`img`);let spinner=document.getElementById(`ms`);let mainDiv=document.getElementById(`md`);let noJsDiv=document.getElementById(`mnjd`);let jsRequiredDivs=document.getElementsByClassName(jsRequiredDivName);noJsDiv.classList.add(`d-none`);Array.from(jsRequiredDivs).forEach(item=>{item.classList.remove(jsRequiredDivName)});function hasAllTheImagesBeenLoaded(){for(let image of images){if(!image.complete)return false}return true}let interval=setInterval(()=>{if(hasAllTheImagesBeenLoaded()){spinner.classList.add(`d-none`);mainDiv.classList.remove(`d-none`);clearInterval(interval)}},100);for(let image of images){image.style.pointerEvents=`none`;image.classList.add(`noselect`)}}